import "./AfterLoginBlock.css";

const AfterLoginBlock = () => {
  return (
    <div className="AfterLoginBlockMain">
      <div className="LHSBlock">
        <div>
            <button type="button" className="btn btn-light btn-Custom-Size">Profile</button>
        </div>
        <div>
            <h1>Appointment</h1>
        </div>
        <div>
            <h1>Booking History</h1>
        </div>
        <div>
            <h1>Logout</h1>
        </div>
      </div>
      <div className="RHSBlock">
        <h1>RHS BLOCK</h1>
      </div>
    </div>
  );
};

export default AfterLoginBlock;
